import React from "react"
import ReactDOM from "react-dom"
import "./index.css"

// aero function App
const App = () => {

    
    return (
        <div className="App">
            Hello World!
        </div>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
